import axios from 'axios'
import React from 'react'
import classes from '../OrderDetail/OrderDetail.module.css'
import VideoCard from '../../Components/VideoCard/VideoCard'

class OrderDetail extends React.Component{
 state ={
     orderdetail:[],
 }
 
componentDidMount(){
    console.log('Inside')
    axios.get("https://5d76bf96515d1a0014085cf9.mockapi.io/playlist")
    .then((response)=>{
        console.log(response.data);
        this.setState({orderdetail:[...response.data]});
    })
    .catch(err => {
        console.log(err);
    });
}

render(){
    return(
        <div className={classes.Main}>
        <h1 className={classes.MainHeading}>Order Detail</h1>
        <div className={classes.Maincard}>
        {
            this.state.orderdetail.map(item =>{
                return <VideoCard customerName={item.customerName} />
            })
        }
        </div>
        </div>
    );
}


}

export default OrderDetail;
